import React from "react";

const Outputpage = ({ timetableData }) => {
  if (!timetableData) return <div>No timetable data available</div>;

  return (
    <div>
      <h2>Timetable for {timetableData.name}</h2>
      <p>Days per week: {timetableData.daysPerWeek}</p>
      <p>Study hours per day: {timetableData.studyHoursPerDay}</p>
      <p>Break intervals: {timetableData.breakInterval} hours</p>
      <p>Break duration: {timetableData.breakDuration} minutes</p>
      <h3>Subjects:</h3>
      <ul>
        {timetableData.subjects.map((subject, index) => (
          <li key={index}>
            {subject.subject} - {subject.credits} credits
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Outputpage;
